    },
];

class Animation extends Component{

    render(){
        return(
            <div className="Animation-container">
                <div className="top-design">
                </div>
                <Plx    parallaxData={parallaxData}>


                </Plx>
                    <div className="mid-bg"></div>
                    <div className="mid-bg"></div>
                    <div className="mid-bg"></div>
                    <div className="mid-bg"></div>




            </div>
        );
    }

}

export default Animation;
